INSERT INTO `cursos` (`id`, `nome`, `descricao`, `valor`, `data_inicio`, `data_fim`, `qtd_inscritos`, `deleted_at`, `created_at`, `updated_at`) VALUES
('945459cd-be55-48be-9b6c-c3704e498ea6', 'Curso de PHP Avançado', '<p>A Formação PHP da Alura é um guia de aprendizado com cursos e conteúdos para você iniciar uma carreira bem sucedida como programador(a) Web PHP. Você vai aprender desde os fundamentos da linguagem junto com as boas práticas e o essencial conhecimento de uma boa modelagem orientada a objetos.</p><p><b>O que é PHP?</b><br></p><p>O PHP é uma das linguagens de programação mais usada no desenvolvimento web. Por ser multi plataforma, open source, gratuita e bastante completa, a linguagem PHP conquistou o mercado e desenvolvedoras/es, tendo uma comunidade vibrante e uma evolução rápida nos últimos anos.</p>', 10.50, '2021-09-05', '2021-09-24', 10, NULL, '2021-09-06 03:47:28', '2021-10-10 19:55:25'),
('9455bb42-b91b-4bc0-8e86-b07117c15f26', 'Curso de Laravel Avançado', '<div><ul class=\"curso-detalhes-habilidades-list\" style=\"box-sizing: inherit; margin-right: 1.23em; margin-bottom: 2.25em; margin-left: 1.23em; padding: 0px; text-size-adjust: none; font-size: 0.9375rem; color: rgb(9, 51, 102); font-family: Inter, sans-serif; background-color: rgb(252, 253, 255);\"><li class=\"curso-detalhes-habilidades-item\" style=\"box-sizing: inherit; margin: 0px; padding: 0px; text-size-adjust: none; font-size: 1rem; font-stretch: normal; line-height: 1.69;\"><span style=\"font-family: &quot;Times New Roman&quot;;\">Entenda o padrão MVC com Laravel</span></li><li class=\"curso-detalhes-habilidades-item\" style=\"box-sizing: inherit; margin: 0px; padding: 0px; text-size-adjust: none; font-size: 1rem; font-stretch: normal; line-height: 1.69;\"><span style=\"font-family: &quot;Times New Roman&quot;;\">Use o ORM Eloquent para persistir dados</span></li><li class=\"curso-detalhes-habilidades-item\" style=\"box-sizing: inherit; margin: 0px; padding: 0px; text-size-adjust: none; font-size: 1rem; font-stretch: normal; line-height: 1.69;\"><span style=\"font-family: &quot;Times New Roman&quot;;\">Trabalhe com formulários e validação</span></li><li class=\"curso-detalhes-habilidades-item\" style=\"box-sizing: inherit; margin: 0px; padding: 0px; text-size-adjust: none; font-size: 1rem; font-stretch: normal; line-height: 1.69;\"><span style=\"font-family: &quot;Times New Roman&quot;;\">Ganhe produtividade no desenvolvimento web</span></li><li class=\"curso-detalhes-habilidades-item\" style=\"box-sizing: inherit; margin: 0px; padding: 0px; text-size-adjust: none; font-size: 1rem; font-stretch: normal; line-height: 1.69;\"><span style=\"font-family: &quot;Times New Roman&quot;;\">Use o Blade para a definição dos Views</span></li></ul></div>', 20.30, '2021-09-13', '2021-09-30', 20, NULL, '2021-09-06 20:15:48', '2021-10-10 19:55:25'),
('9491a14f-2e43-4e92-aa54-d1a5969bbea3', 'Curso LaraFood + VueFood + FlutterFood', '<p><span style=\"color: rgb(143, 143, 143); font-family: Montserrat, sans-serif;\">Que tal criar um sistema bem legalzão em Laravel? Vamos criar o LaraFood (o delivery completo feito em Laravel)</span><br></p>', 5.00, '2021-10-06', '2021-10-06', 20, NULL, '2021-10-06 14:52:54', '2021-10-10 19:55:25'),
('9491ad0f-76f3-408b-ac54-a0945e70eec2', 'Curso Laravel Multi-Tenancy Multi Database', '<p><span style=\"color: rgb(143, 143, 143); font-family: Montserrat, sans-serif;\">Aprenda a centralizar diversos tenants no mesmo sistema, e cada uma com o seu próprio database isolado. Aprenda a trabalhar com conceitos avançados do Laravel neste curso!</span><br></p>', 100.00, '2021-10-06', '2021-10-06', 4, NULL, '2021-10-06 15:25:46', '2021-10-10 19:55:25'),
('9491aebe-a848-40f4-b5ac-cb666b47515d', 'Curso Laravel Multi-Tenancy - Single Database', '<h1 class=\"heading-17\" style=\"font-size: 24px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; font-weight: 500; line-height: 29px; font-family: Montserrat, sans-serif; color: rgb(51, 51, 51);\"><span style=\"color: rgb(143, 143, 143); font-size: 14px;\">Aprenda a criar aplicações que centralizam N empresas. Neste formato facilita a manutenção da aplicação, e criação de novas features, porque o código de todas as empresas é centralizado</span><br></h1>', 100.00, '2021-10-06', '2021-10-06', 2, NULL, '2021-10-06 15:30:28', '2021-10-10 19:55:25'),
